trailingComments.value:
*
 * 打开书架页
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example 调用示例
 *  libSQ.exec('open-book-shelf').then(function (info) {
 *    alert('[from ready][open-book-shelf][then] ' + JSON.stringify(info, null, 2));
 *  }).catch(function (err) {
 *    alert('[from ready][open-book-shelf][error] ' + JSON.stringify(err, null, 2));
 *  });
 *

